      subject: 'Thank you for registering!'
      body: "<p>Thank you for registering for the&nbsp;Navigating Our Relationships with Clients Meeting.<br />\r\n<br />\r\nTime: February 9, 2022 | 07:00 - 8:00 PM Pacific Time&nbsp;<br />\r\nLocation: Zoom Meetings<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Virtual Meeting: What to Expect</strong><br />\r\nA DoveLewis representative will email you to confirm your attendance and provide you the Zoom login information.<br />\r\n<br />\r\n<em>Please join&nbsp;10 minutes prior&nbsp;to see if your connection and video are good.&nbsp;</em><br />\r\n<br />\r\nIf the Zoom app is not already on your device, you can download the app here:&nbsp;<a href=\"http://www.zoom.us/\">www.zoom.us</a><br />\r\n<br />\r\n<strong>Tip:</strong> Zoom allows you to test to see if your mic works which we recommend doing as you join the meeting. We also ask that you&nbsp;enable your camera. You will be able to join the meeting before the leaders/hosts join the meeting.<br />\r\n<br />\r\nWhen the meeting begins, make sure you are viewing via the &ldquo;Gallery View&rdquo; which is in the top right corner on your computer screen. This allows&nbsp;you&nbsp;to see the other members.<br />\r\n<br />\r\n<strong>It is best to use a desktop or laptop</strong>. The visual possibilities are less on other devices and phones.&nbsp;You may wish to use headphones for privacy, depending upon where you are joining from. If you are able to plug directly into your router, please do so.&nbsp; Otherwise, ensure that you are close enough to your wireless source to have a good signal.<em>&nbsp; </em></p>\r\n\r\n<p>Thank you for registering and we look forward to seeing you at&nbsp;our meeting!</p>"
